(1, 1, 'Um comentarista do WordPress', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2020-03-08 17:23:26', '2020-03-08 20:23:26', 'Olá, isso é um comentário.\nPara começar a moderar, editar e excluir comentários, visite a tela de Comentários no painel.\nAvatares de comentaristas vêm a partir do <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', '', 0, 0),
(2, 546, '', '', '', '', '2015-11-11 12:24:59', '2015-11-11 12:24:59', '', 0, 'post-trashed', '', '', 0, 0),
(3, 446, 'Mr WordPress', '', 'https://wordpress.org/', '', '2015-09-28 14:59:36', '2015-09-28 13:59:36', 'Hi, this is a comment.\nTo delete a comment, just log in and view the post&#039;s comments. There you will have the option to edit or delete them.', 0, '1', '', '', 0, 0),
(4, 446, 'tommus', 'fake@email.com', '', '::1', '2015-10-30 13:47:42', '2015-10-30 13:47:42', 'This is a comment reply.', 0, '1', '', '', 3, 0);
